import React, { useEffect, useState } from 'react';
import PostCard from './PostCard';
import './HomePage.css';

const HomePage = () => {
  const [posts, setPosts] = useState([
    { id: '1', title: 'First Post', content: 'This is the first post content', image: 'sample-image1.jpg' },
    { id: '2', title: 'Second Post', content: 'This is the second post content', image: 'sample-image2.jpg' },
  ]);

  return (
    <div className="home-page">
      <h2>Blog Posts</h2>
      <div className="post-list">
        {posts.map(post => (
          <PostCard key={post.id} post={post} />
        ))}
      </div>
    </div>
  );
};

export default HomePage;
